import{_ as t}from"./plugin-vue_export-helper-c27b6911.js";import{o as d,c as r,e}from"./app-a63d3fdb.js";const o={},a=e('<h2 id="dom事件" tabindex="-1"><a class="header-anchor" href="#dom事件" aria-hidden="true">#</a> DOM事件</h2><p><strong>事件是用户和浏览器之间的交互行为</strong></p><h3 id="_2-1-鼠标事件" tabindex="-1"><a class="header-anchor" href="#_2-1-鼠标事件" aria-hidden="true">#</a> 2.1 鼠标事件</h3><table><thead><tr><th>属性</th><th>描述</th></tr></thead><tbody><tr><td>onclick</td><td>当用户点击某个对象时调用的事件句柄。单击鼠标左键或者按下回车键时触发,意味着onclick事件处理程序既可以通过键盘也可以通过鼠标执行</td></tr><tr><td>oncontextmenu</td><td>在用户点击鼠标右键打开上下文菜单时触发。可以用做自定义菜单</td></tr><tr><td>ondblclick</td><td>当用户双击某个对象时调用的事件句柄。双击鼠标左键时触发</td></tr><tr><td>onmousedown</td><td>鼠标按钮被按下。</td></tr><tr><td>onmouseenter</td><td>当鼠标指针移动到元素上时触发。该事件不冒泡，即鼠标移到其后代元素上时不会触发。</td></tr><tr><td>onmouseleave</td><td>当鼠标指针移出元素时触发。该事件不冒泡，即鼠标移出其后代元素时不会触发。</td></tr><tr><td>onmousemove</td><td>鼠标被移动。</td></tr><tr><td>onmouseover</td><td>鼠标移到某元素之上。鼠标移到其后代元素上时会触发,意味着支持冒泡</td></tr><tr><td>onmouseout</td><td>鼠标从某元素移开。支持冒泡</td></tr><tr><td>onmouseup</td><td>鼠标按键被松开。</td></tr></tbody></table><h3 id="_2-2-键盘事件" tabindex="-1"><a class="header-anchor" href="#_2-2-键盘事件" aria-hidden="true">#</a> 2.2 键盘事件</h3><table><thead><tr><th>属性</th><th>描述</th></tr></thead><tbody><tr><td>onkeydown</td><td>某个键盘按键被按下。</td></tr><tr><td>onkeypress</td><td>某个键盘按键被按下并松开。</td></tr><tr><td>onkeyup</td><td>某个键盘按键被松开。</td></tr></tbody></table><h3 id="_2-3-框架-对象事件" tabindex="-1"><a class="header-anchor" href="#_2-3-框架-对象事件" aria-hidden="true">#</a> 2.3 框架/对象事件</h3><table><thead><tr><th>属性</th><th>描述</th></tr></thead><tbody><tr><td>onabort</td><td>图像的加载被中断。 ( <code>&lt;object&gt;</code>)</td></tr><tr><td>onbeforeunload</td><td>该事件在即将离开页面（刷新或关闭）时触发</td></tr><tr><td>onerror</td><td>在加载文档或图像时发生错误。 ( <code>&lt;object&gt;</code>, <code>&lt;body&gt;</code>和 <code>&lt;frameset&gt;</code>)</td></tr><tr><td>onhashchange</td><td>该事件在当前 URL 的锚部分发生修改时触发。</td></tr><tr><td>onload</td><td>一张页面或一幅图像完成加载。</td></tr><tr><td>onpageshow</td><td>该事件在用户访问页面时触发</td></tr><tr><td>onpagehide</td><td>该事件在用户离开当前网页跳转到另外一个页面时触发</td></tr><tr><td>onresize</td><td>窗口或框架被重新调整大小。由window调用</td></tr><tr><td>onscroll</td><td>当文档被滚动时发生的事件。</td></tr><tr><td>onunload</td><td>用户退出页面。 ( <code>&lt;body&gt;</code> 和 <code>&lt;frameset&gt;</code>)</td></tr></tbody></table><h3 id="_2-4-表单事件" tabindex="-1"><a class="header-anchor" href="#_2-4-表单事件" aria-hidden="true">#</a> 2.4 表单事件</h3><table><thead><tr><th>属性</th><th>描述</th></tr></thead><tbody><tr><td>onblur</td><td>元素失去焦点时触发</td></tr><tr><td>onchange</td><td>该事件在表单元素的内容改变时触发( <code>&lt;input&gt;</code>, <code>&lt;keygen&gt;</code>, <code>&lt;select&gt;</code>, 和 <code>&lt;textarea&gt;</code>)</td></tr><tr><td>onfocus</td><td>元素获取焦点时触发</td></tr><tr><td>onfocusin</td><td>元素即将获取焦点时触发</td></tr><tr><td>onfocusout</td><td>元素即将失去焦点时触发</td></tr><tr><td>oninput</td><td>元素获取用户输入时触发</td></tr><tr><td>onreset</td><td>表单重置时触发</td></tr><tr><td>onsearch</td><td>用户向搜索域输入文本时触发 ( ·&lt;input=&quot;search&quot;&gt;)</td></tr><tr><td>onselect</td><td>用户选取文本时触发 ( <code>&lt;input&gt; </code>和<code> &lt;textarea&gt;</code>)</td></tr><tr><td>onsubmit</td><td>表单提交时触发</td></tr></tbody></table><h3 id="_2-5-剪贴板事件" tabindex="-1"><a class="header-anchor" href="#_2-5-剪贴板事件" aria-hidden="true">#</a> 2.5 剪贴板事件</h3><table><thead><tr><th>属性</th><th>描述</th></tr></thead><tbody><tr><td>oncopy</td><td>该事件在用户拷贝元素内容时触发</td></tr><tr><td>oncut</td><td>该事件在用户剪切元素内容时触发</td></tr><tr><td>onpaste</td><td>该事件在用户粘贴元素内容时触发</td></tr></tbody></table><h3 id="_2-6-打印事件" tabindex="-1"><a class="header-anchor" href="#_2-6-打印事件" aria-hidden="true">#</a> 2.6 打印事件</h3><table><thead><tr><th>属性</th><th>描述</th></tr></thead><tbody><tr><td>onafterprint</td><td>该事件在页面已经开始打印，或者打印窗口已经关闭时触发</td></tr><tr><td>onbeforeprint</td><td>该事件在页面即将开始打印时触发</td></tr></tbody></table><h3 id="_2-7-拖动事件" tabindex="-1"><a class="header-anchor" href="#_2-7-拖动事件" aria-hidden="true">#</a> 2.7 拖动事件</h3><table><thead><tr><th>事件</th><th>描述</th></tr></thead><tbody><tr><td>ondrag</td><td>该事件在元素正在拖动时触发</td></tr><tr><td>ondragend</td><td>该事件在用户完成元素的拖动时触发</td></tr><tr><td>ondragenter</td><td>该事件在拖动的元素进入放置目标时触发</td></tr><tr><td>ondragleave</td><td>该事件在拖动元素离开放置目标时触发</td></tr><tr><td>ondragover</td><td>该事件在拖动元素在放置目标上时触发</td></tr><tr><td>ondragstart</td><td>该事件在用户开始拖动元素时触发</td></tr><tr><td>ondrop</td><td>该事件在拖动元素放置在目标区域时触发</td></tr></tbody></table><h3 id="_2-8-多媒体事件" tabindex="-1"><a class="header-anchor" href="#_2-8-多媒体事件" aria-hidden="true">#</a> 2.8 多媒体事件</h3><table><thead><tr><th>事件</th><th>描述</th></tr></thead><tbody><tr><td>onabort</td><td>事件在视频/音频（audio/video）终止加载时触发。</td></tr><tr><td>oncanplay</td><td>事件在用户可以开始播放视频/音频（audio/video）时触发。</td></tr><tr><td>oncanplaythrough</td><td>事件在视频/音频（audio/video）可以正常播放且无需停顿和缓冲时触发。</td></tr><tr><td>ondurationchange</td><td>事件在视频/音频（audio/video）的时长发生变化时触发。</td></tr><tr><td>onemptied</td><td>当期播放列表为空时触发</td></tr><tr><td>onended</td><td>事件在视频/音频（audio/video）播放结束时触发。</td></tr><tr><td>onerror</td><td>事件在视频/音频（audio/video）数据加载期间发生错误时触发。</td></tr><tr><td>onloadeddata</td><td>事件在浏览器加载视频/音频（audio/video）当前帧时触发触发。</td></tr><tr><td>onloadedmetadata</td><td>事件在指定视频/音频（audio/video）的元数据加载后触发。</td></tr><tr><td>onloadstart</td><td>事件在浏览器开始寻找指定视频/音频（audio/video）触发。</td></tr><tr><td>onpause</td><td>事件在视频/音频（audio/video）暂停时触发。</td></tr><tr><td>onplay</td><td>事件在视频/音频（audio/video）开始播放时触发。</td></tr><tr><td>onplaying</td><td>事件在视频/音频（audio/video）暂停或者在缓冲后准备重新开始播放时触发。</td></tr><tr><td>onprogress</td><td>事件在浏览器下载指定的视频/音频（audio/video）时触发。</td></tr><tr><td>onratechange</td><td>事件在视频/音频（audio/video）的播放速度发送改变时触发。</td></tr><tr><td>onseeked</td><td>事件在用户重新定位视频/音频（audio/video）的播放位置后触发。</td></tr><tr><td>onseeking</td><td>事件在用户开始重新定位视频/音频（audio/video）时触发。</td></tr><tr><td>onstalled</td><td>事件在浏览器获取媒体数据，但媒体数据不可用时触发。</td></tr><tr><td>onsuspend</td><td>事件在浏览器读取媒体数据中止时触发。</td></tr><tr><td>ontimeupdate</td><td>事件在当前的播放位置发送改变时触发。</td></tr><tr><td>onvolumechange</td><td>事件在音量发生改变时触发。</td></tr><tr><td>onwaiting</td><td>事件在视频由于要播放下一帧而需要缓冲时触发。</td></tr></tbody></table><h3 id="_2-9-动画事件" tabindex="-1"><a class="header-anchor" href="#_2-9-动画事件" aria-hidden="true">#</a> 2.9 动画事件</h3><table><thead><tr><th>事件</th><th>描述</th></tr></thead><tbody><tr><td>animationend</td><td>该事件在 CSS 动画结束播放时触发</td></tr><tr><td>animationiteration</td><td>该事件在 CSS 动画重复播放时触发</td></tr><tr><td>animationstart</td><td>该事件在 CSS 动画开始播放时触发</td></tr></tbody></table><h3 id="_2-10-过渡事件" tabindex="-1"><a class="header-anchor" href="#_2-10-过渡事件" aria-hidden="true">#</a> 2.10 过渡事件</h3><table><thead><tr><th>事件</th><th>描述</th></tr></thead><tbody><tr><td>transitionend</td><td>该事件在 CSS 完成过渡后触发。</td></tr></tbody></table><h3 id="_2-11-其他事件" tabindex="-1"><a class="header-anchor" href="#_2-11-其他事件" aria-hidden="true">#</a> 2.11 其他事件</h3><table><thead><tr><th>事件</th><th>描述</th></tr></thead><tbody><tr><td>onmessage</td><td>该事件通过或者从对象(WebSocket, Web Worker, Event Source 或者子 frame 或父窗口)接收到消息时触发</td></tr><tr><td>onmousewheel</td><td>已废弃。 使用 onwheel事件替代</td></tr><tr><td>ononline</td><td>该事件在浏览器开始在线工作时触发。</td></tr><tr><td>onoffline</td><td>该事件在浏览器开始离线工作时触发。</td></tr><tr><td>onpopstate</td><td>该事件在窗口的浏览历史（history 对象）发生改变时触发。</td></tr><tr><td>onshow</td><td>该事件当 <code>&lt;menu&gt;</code> 元素在上下文菜单显示时触发</td></tr><tr><td>onstorage</td><td>该事件在 Web Storage(HTML 5 Web 存储)更新时触发</td></tr><tr><td>ontoggle</td><td>该事件在用户打开或关闭 <code>&lt;details&gt; </code>元素时触发</td></tr><tr><td>onwheel</td><td>该事件在鼠标滚轮在元素上下滚动时触发</td></tr><tr><td>DOMMouseScroll</td><td>火狐(firefox)支持的绑定鼠标滚轮的事件，并且该事件必须要通过addEventListener()函数来绑定事件</td></tr><tr><td>DOMContentLoaded</td><td>监听文档DOM元素的内容是否加载完成，比onload事件要监听的东西更少，DOM元素加载完毕后就会执行该事件,通过addEventListener()函数来绑定事件</td></tr></tbody></table>',24),n=[a];function h(i,c){return d(),r("div",null,n)}const b=t(o,[["render",h],["__file","db2.html.vue"]]);export{b as default};
